import React from 'react';

const BannerImage = ({ src, alt, style }) => {
  return (
    <div style={{ position: 'relative', overflow: 'hidden', ...style }}>
      <img src={src} alt={alt} style={{ width: '100%', height: 'auto', display: 'block' }} />
    </div>
  );
};

export default BannerImage;
